class UserTemplate {
    constructor(id,name, surname, email, phone, city, street, houseNumber, zipcode, age, password) {
        this.id = id;
        this.name = name;
        this.surname = surname;
        this.email = email;
        this.phone = phone;
        this.city = city;
        this.street = street;
        this.houseNumber = houseNumber;
        this.zipcode = zipcode;
        this.age = age;
        this.password = password;
    }
}
export default UserTemplate